import { defineStore } from 'pinia'

export const useStudentStore = defineStore('student', {
  state: () => ({
    studentList: [
      {
        name: '张三',
        studentId: '201811111111',
        username: 'zhangsan',
        grade: '电计2021',
        major: '电子与计算机工程',
        education: '本科',
        email: '1213770427@qq.com',
        phoneNumber: '13078901234',
        //证件类型
        idType: '身份证',
        //证件号码
        idNumber: '111111111111111111',
        // 学生证件照
        avatar:
          'data:image/png;base64,',

        // 入学年费
        admissionYear: '2018',
        // 毕业年份
        graduationYear: '2022',
        // 学校
        school: '华南理工大学'
      }
    ]
  }),

  actions: {
    addStudent(student) {
      const index = this.studentList.findIndex(
        (student) => student.studentId === student.studentId
      )
      if (index !== -1) {
        this.studentList.push(student)
        this.localStudentList()
        return true
      } else {
        console.error('已存在该学生')
        return false
      }
    },
    editStudent(sutdent) {
      const index = this.studentList.findIndex(
        (student) => student.studentId === sutdent.studentId
      )
      if (index !== -1) {
        Object.assign(this.studentList[index], sutdent)
      }
      this.localStudentList()
    },
    deleteStudent(studentId) {
      console.log(this.studentList, studentId, 'studentId')
      const index = this.studentList.findIndex(
        (student) => student.studentId === studentId
      )
      // 如果找到了对应的学生索引，则从数组中删除
      if (index !== -1) {
        this.studentList.splice(index, 1)
      } else {
        console.error('未找到对应的学生')
      }
      this.localStudentList()
    },
    localStudentList() {
      localStorage.setItem('studentList', JSON.stringify(this.studentList))
    },
    getLocalStudentList() {
      const studentList = localStorage.getItem('studentList')
      if (studentList) {
        this.studentList = JSON.parse(studentList)
        return this.studentList
      } else {
        return this.studentList
      }
    }
  }
})
